b'#Ascott has launched its new \xe2\x80\x98Discover ASR\xe2\x80\x99 mobile app for members of its loyalty programme, Ascott Star Rewards (ASR). The \xe2\x80\x98Discover ASR\xe2\x80\x99 mobile app is a one-stop 24/7 digital concierge for ASR members, allowing them to search for special deals, book stays and more!

In conjunction with the launch of the new \xe2\x80\x98Discover ASR\xe2\x80\x99 mobile app,  Ascott is also organising a #DiscoverASR Virtual Travel Festival, bringing global travel to the homes of fans and audiences of the @discoverasr social media channels.  Through a livestream, giveaways and weekly contests, customers will get to snag protips, insider recommendations, and over S$12,000 worth of ASR points and staycation prizes.  Download the new \xe2\x80\x98Discover ASR\xe2\x80\x99 mobile app and sign up for a complimentary ASR membership now! Watch our video to find out more!

